// SPDX-License-Identifier: MIT
pragma solidity >=0.8.0 <0.9.0;
import "./libraries/UserLib.sol";

interface IYoukiIdentity {
    function setIdentityAdditionalData(
        UserLib.Maritalstatus _Maritalstatus,
        string memory _education,
        string memory _nationality,
        string[] memory  _furtherNationalities,
        string memory _dateOfBirth,
        string memory _placeOfBirth,
        string memory _countryOfBirth,
        string memory _title, 
        string memory _profession
        ) external;

    function setIdentityAddress(
        string memory _streetHouseNumber,// !=0
        string memory _zip ,// !=0
        string memory _city,// !=0
        string memory _country// !=0  
        ) external;

    function roleExists( uint _role) external view returns (bool);

    function getIdentity() external view returns (UserLib.Identity memory);

    function getEmailHash() external view returns (bytes32);

    function deployNewRole(uint _role) external returns (address roleAddress);

}
